import logo from './logo.svg';
import './App.css';
import Home from './Component/Home/Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Header from './Component/Header/Header';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header></Header>
        <Router>
          <Switch>
            <Route path="/home">
              <Home />
              </Route>

            <Route exact path="/">
              <Home />
            </Route>
          </Switch>
        </Router>
        <Home></Home>
      </header>
    </div>
  );
}

export default App;
